import { Route, Router, Routes } from 'react-router-dom';
import './App.css';

function App() {
  return (
    <Router>
      <div className="App">
        <Routes>
          <Route path='/' element={<div><Header /><Home /></div>} />
          <Route path='/login' element={<Login />} />
          <Route path='/join' element={<Join />} />
          <Route path='/article' element={<div><Header /><Article /></div>} />
          <Route path='/article/:id' element={<div><Header /><Board /></div>} />
          <Route path='/post' element={<div><Header /><Post /></div>} />
          <Route path='/mypage' element={<div><Header /><MyPage /></div>} />
          <Route path='/interests' element={<div><Header /><InterestList /></div>} />
          <Route path='/mypost' element={<div><Header /><MyPost /></div>} />
          <Route path='/search/:title' element={<div><Header /><SearchPage /></div>} />
          <Route path='/editboard/:id' element={<div><Header /><EditBoard /></div>} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
